import React, {useContext, useState, useEffect} from 'react'
import ApiContext from '../context/ApiContext'
import Router from 'next/router';
import Headx from '../components/Head'
import '../css/index.css'
import {
    Row,
    Col,
    Container,
    Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle
} from 'reactstrap'
import List from '../components/List';
function index() {
    const [theList, settheList] = useState([])
    const {list, setId} = useContext(ApiContext)

    useEffect(() => {
        if (list) {
            settheList(list)
        }
        
    }, [list])

    return (
        <Headx title={'Welcome'}>
            <div style={{background:'#eeeeee',top:'50px',position:'fixed',height:'100%',overflowY:'scroll'}}>
                
                        {
                            theList && list ?
                                <div className="get-list" style={{background:'#ffffff',bottom:'30px',position:'relative',height:'auto',padding:'10px 10px', paddingBottom:'60px'}}>
                                    <Container>
                                        <Row>
                                            <Col>
                                                <p>LISTING</p>
                                            </Col>
                                        </Row>
                                        <List />
                                    </Container>
                                </div>
                                    
                            :''
                        }
                        
            </div>
        </Headx>
            
    )
}

export default index
